INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "春咲 ひより", 1, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 0, "お！\nあそこに困ってそうな人発見！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "草野 優衣", 1, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "みんなみたいに\nわたしも強くならなきゃ", 1002, 0, "大切な人を\n守れるようになりたい…って", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "士条 怜", 1, 1, "少しは磨かれると思いますよ。", 1, "フェンシングを始めてみては？", 1003, 0, "キミに必要な集中力と感性が", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "穂高 みそぎ", 1, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "ねぇ、にいちゃん！", 1004, 0, "今日はなにして遊ぶ？", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "風宮 あかり", 1, 1, "私といっしょに…\nいかない？", 1, "風宮あかりです", 1006, 0, "ねぇ…", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "出雲 宮子", 1, 1, "食べ物の恨みは怖いのー", 1, "出雲宮子なのー", 1007, 0, "プリンたべたいのー", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "虹村 雪", 1, 1, "いいよ。\n見られることは運命さ…", 1, "ボクは虹村雪。", 1008, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "柊杏奈", 1, 1, "人呼んで「疾風の冥姫」!!", 1, "フッ…聞いて後悔するがいい！", 1009, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "姫宮 真歩", 1, 1, "ほんまおおきにやわ～♪", 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "衣之咲 璃乃", 1, 1, "ここで会ったが\n100年目～！", 1, "衣之咲璃乃です！", 1011, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "柏崎 初音", 1, 1, "…って、お願い！\n誰にも言わないでおいて～！", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 0, "ち、超能力って…\n何のことかな～？", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "美波 鈴奈", 1, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "ちょす！\n美波鈴奈だよ～♪", 1016, 0, "一応カリスマ読モJKやってまっす！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "喜屋武 香織", 1, 1, "でも、沖縄もとってもいいとこさー", 1, "はいたーい。\n喜屋武香織さー。", 1017, 0, "東京は遊園地みたいなところさー", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "支倉 伊緒", 1, 1, "イオちゃんって呼んでね。", 1, "支倉伊緒です。", 1018, 0, "先生って呼ばれるのは\nくすぐったいから", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "茜 ミミ", 1, 1, "ミミをおいてかないでぇ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "栗林 くるみ", 1, 1, "ふぇぇぇぇぇん……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 0, "あの……\nふぇ……", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "風宮 より", 1, 1, "なんてありがとうございます！", 1, "風宮よりです。\nあああああ！", 1022, 0, "こんな私に貴重な時間を\n割いていただき、", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "北条 綾音", 1, 1, "私こっち行きたいー\nね、早く早くー", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 0, "おにいちゃんどこいくの？\nえ？", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "天野 すずめ", 1, 1, "これて何か違う…\nあああすみません！", 1, "わっ…わっ…私、\n天野すずめといいます！", 1025, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "倉石 恵理子", 1, 1, "離しませんわ………\n絶対に…!!", 1, "……クスクス…私は\n…倉石恵理子……", 1027, 0, "あなたは…運命の……\n伴侶……", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "佐々木 咲恋", 1, 1, "…そうでしょ？？", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "桜井 望", 1, 1, "あはは、\n私もまだまだだなぁ～", 1, "桜井望だよ！\nよろしくねっ", 1029, 0, "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "ニノン・ジュベール", 1, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "デケデケデンっ！", 1030, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "上喜 しのぶ", 1, 1, "おかしいですね……", 1, "上喜しのぶです。\n手元のドクロが父です。", 1031, 0, "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "野戸まひる", 1, 1, "そう、\nオラのボケに突っ込める相方が…！", 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 0, "けんども\nそれには足りないモンが…", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "綾瀬 ゆかり", 1, 1, "ちょ\nちょっと一杯飲んできます…！", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 0, "ちょっと緊張しちゃって…", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "氷川 鏡華", 1, 1, "これ以上お話しすることは…\nないです！", 1, "氷川鏡華…です", 1036, 0, "知らない人とは話しちゃいけないので", 0, 0, 0, 1.5);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "柏崎 栞", 1, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "柏崎…栞です。", 1038, 0, "……あ、アラーム。", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "双葉 碧", 1, 1, "野に咲く花が、\n唯一の話相手です。", 1, "ふ、双葉碧です。", 1040, 0, "私、一人も友達がいなくて……", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "三角 千歌", 1, 1, "そう思っています。", 1, "三角千歌です。", 1042, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "安芸 真琴", 1, 1, "う、疑ってすまなかったな…", 1, "安芸真琴だ。", 1043, 0, "あぁ？\nお前のそいつの仲間か？", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "イリヤ・オーンスタイン", 1, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "わらわこそは夜を総べる者！", 1044, 0, "生けとし生ける全ての者よ！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "遠見 空花", 1, 1, "ｌク、クウカに何かご用ですか!?", 1, "そこで騎士は妖精を乱暴に……", 1045, 0, "ぐふふふふ……はっ！", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "宮坂たまき", 1, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "大神 美冬", 1, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "大神美冬よ！", 1048, 0, "それでは早速クエストに…", 0, 0, 0, 1.4);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 0, "星野静流", 1, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "星野静流だよ！", 1049, 0, "クエストもバトルも\n掃除も洗濯も", 0, 0, 0, 1.4);
